div.div:
quando viene premuto il pulsante di reset il condensatore si scarica a massa;
La tensione ai capi del condensatore viene fatta passare attraverso uno squadratore di tensione, detto trigger di Schmitt, che d in uscita il valore 1 oppure 0, a seconda che la tensione sia sopra una soglia alta o sotto una soglia bassa. Pertanto, quello che succede quando si preme il pulsante di reset che luscita di questo circuito resta bassa per un bel po.
L'uscita /reset attiva bassa, ovvero quando =0, la memoria va nello stato iniziale desiderato a prescindere dal valore degli altri loro ingressi, quando =1 non interferisce con il funzionamento della memoria

La ram (per come la vedremo noi) dotata di un numero di fili d'indirizzo in ingresso sufficienti per indirizzare tutte le celle di memoria che sono (2^23 celle da 4 bit ==8 mega), per cui saranno 23 fili d'indirizzo;
di un certo numero di fili di dati ingresso ed uscita (quindi controllati con un tri-state) che in questo esempio sono 4;
Due segnali attivi bassi che mi indicano se sto leggendo o scrivendo
un segnale di selezione attivo basso che quindi quando vale 0 risulta sensibile agli ingressi, avere questo ingresso (e magari anche con un decoder) permetter di realizzare memorie grani (in num di celle) unendo memorie pi piccole, ma viene visto pi avanti.
